  const {form,prodCode} = useFlags()


  return (
    <div className="App">
      <header className="App-header">
        {form ? (<Form/>) : (<div/>)}
        {prodCode ? (<ProdFeature/>) : (<div/>)}
      </header>
    </div>
  );
}
export default withLDProvider({
  clientSideID: '62ccb4c384101710f3c13a21'
